import React from "react";
import Home from "../components/Home"
import '../styles/Homepage.css';
import Navbar from '../components/Navbar'

const Homepage = () => (
    <Grid container spacing={3}>
        <Grid item xs={12}>
            <Navbar/>
        </Grid>
        <Home/>
    </Grid>
);

export default Homepage;
